import React from 'react';

const FieldsViewer=({label, handleChange, type="text"})=>{
    
    return(
        <div>
           <label>{label}:</label>
           <input
               // required
                type={type}
                placeholder={label}
                onChange={handleChange}
                >          
           </input>
        </div>
    );
        
}
const Fieldstyles={
 
    marginTop:"50px",
    background:"#D7BDE2 " ,
    border:"2px solid"
    
}
export default FieldsViewer;
